import React from 'react';
import { render, screen } from '@testing-library/react';
import { Avatar } from './Avatar';

const imageBase64 = 'data:image/jpeg;base64,';

test('Avatar is rendered properly', () => {
  render(
    <Avatar name="Dwigth Schrute" />
  );
  const avatarNode = screen.getByTestId('avatar');

  expect(avatarNode).toBeInTheDocument();
  expect(avatarNode).toHaveClass('ragnarok');
  expect(avatarNode).toHaveClass('avatar');
  expect(avatarNode).toHaveClass('initials');
  expect(avatarNode).toHaveTextContent('DS');
});

test('Avatar is rendered without initials', () => {
  render(
    <Avatar name="Dwigth Schrute" src={imageBase64} />
  );
  const avatarNode = screen.getByTestId('avatar');

  expect(avatarNode).toBeInTheDocument();
  expect(avatarNode).toHaveClass('ragnarok');
  expect(avatarNode).toHaveClass('avatar');
  expect(avatarNode).toHaveClass('photo');
  expect(avatarNode).not.toHaveTextContent('DS');
});
